import React from 'react';
import SummaryBlock from './SummaryBlock';

const Summary = ({ data }) => {
  return (
    <div className="summary-container">
      <h2>Monthly Summary</h2>
      <div className="summary-blocks">
        <SummaryBlock
          icon={<IconGrossEarnings />}
          label="Gross Earnings"
          value={data.grossEarnings}
        />
        <SummaryBlock
          icon={<IconNetEarnings />}
          label="Net Earnings"
          value={data.netEarnings}
        />
        <SummaryBlock
          icon={<IconExpenses />}
          label="Expenses"
          value={data.expenses}
        />
        <SummaryBlock
          icon={<IconMileage />}
          label="Mileage"
          value={data.mileage}
        />
      </div>
      <div className="summary-table">
        <table>
          <thead>
            <tr>
              <th>Gross Earnings</th>
              <th>Expenses</th>
              <th>Net Earnings</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{data.grossEarnings}</td>
              <td>{data.expenses}</td>
              <td>{data.netEarnings}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Summary;
